import HeaderNav from "../components/HeaderNav";

class Home extends Component {
  render() {
    return (
      <div>
        <HeaderNav />
        <div className="flex-row">
          <ProfileSnapshot
            style={aStyle}
            profileDisplay={this.state.profileDisplay}
          />
        </div>
      </div>
    );
  }
}
export default Home;
